import com.esri.core.geometry.ogc.OGCGeometry

val wktFromGeoJson = (json: String) => {
    if (json != null)
        OGCGeometry.fromGeoJson(json).asText()
    else
        ""
}

val stWKTFromGeoJson = udf(wktFromGeoJson)

import org.apache.spark.sql.functions._

//tweetsWithPlaces.select($"place.bounding_box.type".alias("place_geom_type")).show(5)
tweetsWithPlaces.select(stWKTFromGeoJson( to_json($"place.bounding_box")).alias("place_geometry")).where("place is not null").show(5)
